script: |
  super -f text -I q4333.spq | sort > q4333.out

inputs:
  - name: q4333.spq
    data: |
      SELECT DISTINCT + 73 * + cor2.col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q4333.out
    data: |
      511
      5694
      5767
